import React from "react";
import { Link, Route, Routes } from "react-router-dom";

function Header() {
    return (
        <header className="header">
            <div className="header__logo"></div>
            <div >
                <Routes>
                    <Route
                        path="/sign-up"
                        element={
                            <Link className="header__links" to="/sign-in">
                                Вход
                            </Link>
                        }
                    ></Route>
                    <Route
                        path="/sign-in"
                        element={
                            <Link className="header__links" to="/sign-up">
                                Регистрация
                            </Link>
                        }
                    ></Route>
                    <Route
                        path="/"
                        element={
                            <div className="header__links-container">
                                <p className="header__email">some-email@email.ru</p>
                                <Link className="header__links" to="/sign-in">
                                    Выход
                                </Link>
                            </div>
                        }
                    ></Route>
                </Routes>
            </div>

            {/* <Link to={link}>{title}</Link> // прописать стили, возможно обернуть в дополнительный див */}
        </header>
    );
}

export default Header;
